    false,nt"url": null,nt"notes": "This narrative report for Snake Creek National
    Wildlife Refuge outlines Refuge accomplishments from September through December
    of 1957. The report begins by summarizing the weather conditions, water conditions,
    and food and cover during this period. Wildlife- including migratory birds, upland
    game birds, big game animals, furbearers, predators, rodents, mammals, raptors,
    and fish- is also covered. The Refuge development and maintenance section discusses
    physical developments, plantings, and collections and receipts. The public relations
    section of the report describes recreational uses, Refuge visitors, Refuge participation,
    fishing, and violations. Items of interest, N-R forms, and photographs are attached.",nt"license_title":
